import React from 'react';
import { Card  } from 'semantic-ui-react';
import { List } from 'semantic-ui-react'


export default function NoteCardDetail({note}){

    return(<Card key={note._id}>

        <Card.Content>
        <Card.Description>
          {note.title}
          {note.date}
          {note.location}
          {note.description}
        </Card.Description>
        </Card.Content>
      </Card>)
}
